import { Card, Avatar, Button } from "antd";

const UserProfile = () => {
    return (
        <>
            <Card
                actions={[
                    <div key="twit">
                        짹짹
                        <br />0
                    </div>,
                    <div key="followings">
                        팔로잉
                        <br />0
                    </div>,
                    <div key="followers">
                        팔로워
                        <br />0
                    </div>
                ]}
            ></Card>
            <Card.Meta avatar={<Avatar>DK</Avatar>} title="Donghyun Kim" />
        </>
    );
};

export default UserProfile;
